import React from 'react';
import {Link, withRouter} from 'react-router-dom';
import './List.css';

const list = (props) => {
    return (
        <Link to={"/lists/" + props.listId} className="Link">
            <div className = "List" style="position:relative;width:100%;height:50px;">
                <div className = "ListName" style="position:absolute;left:50%;margin-left:-50%;top:50%;margin-top:-25%;width:100%;height:50%;">{props.list.listName}</div>
                <div className = "ListInfo" style="position:absolute;left:50%;margin-left:-50%;top:50%;margin-top:-25%;width:100%;height:50%;">15 tasks left</div>
            </div>
        </Link>
    )
}

export default withRouter(list);
